'),(941,209,'_elementor_template_type','post'),(947,251,'_edit_lock','1524830540:6'),(948,251,'_edit_last','6'),(949,251,'_elementor_edit_mode','builder'),(950,143,'_wp_trash_meta_status','publish'),(951,143,'_wp_trash_meta_time','1524829919'),(952,143,'_wp_desired_post_slug','login-2'),(961,252,'_wp_trash_meta_status','publish'),(962,252,'_wp_trash_meta_time','1524830002'),(963,254,'_edit_lock','1524830044:4'),(964,254,'_wp_trash_meta_status','publish'),(965,254,'_wp_trash_meta_time','1524830045'),(966,251,'_wp_page_template','default'),(967,251,'_elementor_data','[{\"id\":\"d623662\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"3ca6d14\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"a856d2f\",\"elType\":\"widget\",\"settings\":{\"title\":\"Historie, filosofi og religion\"},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"ab7aaa7\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p style=\\\"margin-top: 5px; margin-bottom: 15px; line-height: 23.8px; color: #333333; font-family: \'open sans\', arial, sans-serif; font-size: 14px;\\\">Jobbskyggevert: Ole Nordmann, Arkivator, Aust-Agder Museum og Arkiv, AAMA<br \\/><br \\/>\\u201dJobbskygge-dagen ga meg et godt innblikk i hvordan en dag i arbeidslivet er som arkivator p\\u00e5 AAMA . Jeg fikk v\\u00e6re med p\\u00e5 m\\u00f8ter b\\u00e5de med ledesen, og l\\u00e6rte om bevaring av dokumenter og brev som Ole jobber med n\\u00e5. Jeg hadde sjansen til \\u00e5 sp\\u00f8rre om alt jeg har lurt p\\u00e5 f\\u00f8r, og fikk detaljerte svar. Jobbskygge er en unik mulighet \\u00e5 bli kjent med en vanlig arbeidsdag p\\u00e5 dr\\u00f8mmejobben sin i en avslappet atmosf\\u00e6re. Det kan ogs\\u00e5 ta bort frykten eller respekten for \\u00e5 ringe bedriften eller \\u00e5 skrive en s\\u00f8knad. Jeg fikk motivasjon for \\u00e5 skrive en \\u00e5pen s\\u00f8knad til AAMA\\u201d.<br \\/><br \\/>Student: <strong>Eirik Andre St\\u00e5lesen<\\/strong><\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"483690b\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"605d92e\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"4468c3a\",\"elType\":\"widget\",\"settings\":{\"title\":\"Helse- og sosialfag\"},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"2836075\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p style=\\\"margin-top: 15px; margin-bottom: 15px; line-height: 23.8px; color: #333333; font-family: \'open sans\', arial, sans-serif; font-size: 14px;\\\">Jobbskyggevert: Dole Nordman, Overlege, S\\u00f8rlandet sykehus.<br \\/><br \\/>\\\"Jeg mener at Jobbskyggedagen kan v\\u00e6re en veldig bra mulighet for studenter \\u00e5 f\\u00e5 en bedre forst\\u00e5else for hvordan det er \\u00e5 bruke sin utdanning i arbeidslivet, og hva som kan v\\u00e6re viktig \\u00e5 tenke p\\u00e5 n\\u00e5r det gjelder \\u00e5 komme seg ut i arbeidsmarkedet med den h\\u00f8yere utdanningen man har. I tillegg er det en fin m\\u00e5te \\u00e5 bli kjent med personer som jobber i samme fagfelt som man studerer, og p\\u00e5 den m\\u00e5ten utvide sitt profesjonelle nettverk. Jeg tok med meg noen erfaringer og opplevelser som gj\\u00f8r meg mer bevisst p\\u00e5 hva mine interesser er og hvordan jeg burde tenke fremover i studiel\\u00f8pet, samt at jeg fikk \\u00f8kt motivasjon for studieretningen.\\\"<br \\/><br \\/>Student: <b>Shiwan Hassan<\\/b><\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"043cb1c\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"7953814\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"41a14b8\",\"elType\":\"widget\",\"settings\":{\"title\":\"Ingeni\\u00f8r- og teknologiske fag\"},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"38c1027\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p style=\\\"margin-top: 15px; margin-bottom: 15px; line-height: 23.8px; color: #333333; font-family: \'open sans\', arial, sans-serif; font-size: 14px;\\\">Jobbskyggevert:\\u00a0<a style=\\\"color: #804180; border-bottom: 1px dashed #dddddd;\\\" href=\\\"https:\\/\\/www.ngu.no\\/ansatte\\/fredrik-h-gaas\\\">D<\\/a>offen Nordmann, SivilEngin\\u00f8r, Statoil.<br \\/><br \\/>\\\"Etter feltturen f\\u00f8ler jeg at jeg har satset p\\u00e5 riktig fagfelt, der jeg fikk teste ut utstyr jeg aldri har pr\\u00f8vd f\\u00f8r. Dette gj\\u00f8r at jeg f\\u00e5r en bredere feltkompetanse i arbeidslivet. Det er viktig \\u00e5 utnytte de mulighetene som er tilgjengelig. Selv om det er travelt p\\u00e5 skolen, vil en jobbskyggedag komme sv\\u00e6rt godt med n\\u00e5r man s\\u00f8ker jobb.\\u00a0\\\"<br \\/><br \\/>Student:\\u00a0<strong>Daniel Thorbj\\u00f8rn Miranda Petteresen<\\/strong><\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false}]'),(968,251,'_elementor_version','0.4'),(973,251,'_elementor_css','a:4:{s:4:\"time\";i:1524830665;s:5:\"fonts\";a:0:{}s:6:\"status\";s:5:\"empty\";s:3:\"css\";s:0:\"\";}'),(978,144,'_edit_last','4'),(979,144,'_wp_page_template','default'),(980,144,'_yoast_wpseo_content_score','30'),(981,144,'_wp_trash_meta_status','publish'),(982,144,'_wp_trash_meta_time','1524831223'),(983,144,'_wp_desired_post_slug','register'),(984,125,'_wp_trash_meta_status','draft'),(985,125,'_wp_trash_meta_time','1524831235'),(986,125,'_wp_desired_post_slug',''),(987,102,'_wp_trash_meta_status','publish'),(988,102,'_wp_trash_meta_time','1524831249'),(989,102,'_wp_desired_post_slug','testside'),(990,142,'_edit_lock','1524831114:4'),(991,142,'_wp_trash_meta_status','publish'),(992,142,'_wp_trash_meta_time','1524831265'),(993,142,'_wp_desired_post_slug','user'),(994,255,'_edit_lock','1524831156:4'),(995,255,'_wp_trash_meta_status','publish'),(996,255,'_wp_trash_meta_time','1524831299'),(997,255,'_wp_desired_post_slug','activate'),(998,147,'_wp_trash_meta_status','publish