INSERT INTO `wp_posts` VALUES (1,1,'2017-01-05 16:04:41','2017-01-05 16:04:41','<a href=\"http://alumniuia.wpengine.com/\"><img class=\"alignnone wp-image-115 size-medium\" src=\"http://alumniuia.wpengine.com/wp-content/uploads/2017/01/uiahovedside-300x188.png\" alt=\"\" width=\"300\" height=\"188\" /></a>\r\n\r\nEr du student og lurer p√• hva du skal gj√∏re etter du har studert ferdig?\r\n\r\nKontakt oss!\r\n\r\n&nbsp;\r\n\r\nDaniel, Eirik og Shiwan Har svaret for framtiden din!','Nyheter','','publish','open','open','','hello-world','','','2018-04-13 12:02:24','2018-04-13 11:02:24','',0,'http://wpengine.com7/4.7/?p=1',0,'post','',1),(5,3,'2017-11-01 08:31:13','0000-00-00 00:00:00','Etikk og samfunnsansvar for √∏konomer\n\nBakgrunn\nSE-109 Innf√∏ring i √∏konomisk tekning og etikk er et 7.5 studiepoengs innf√∏ringsemne som alle studenter ved Handelsh√∏yskolen m√• gjennomf√∏re. Innholdet i kurset er regulert av den nasjonale bachelorplanen for √∏konomisk-administrative fag og er utarbeidet av Nasjonalt r√•d for √∏konomisk-administrativ utdanning (NR√òA). Kurset gjennomf√∏res b√•de i Grimstad (ca 60 studenter) og Kristiansand (ca 340 studenter), og de fleste tar emnet i sitt f√∏rste semester.\nH√∏sten 2014 overtok f√∏rstelektor Torunn S. Olsen og undertegnede, f√∏rsteamanuensis Arngrim Hunnes, ansvaret for kurset. Det f√∏rste vi gjorde var √• harmonisere kurset p√• tvers av Grimstad og Kristiansand (felles litteratur, oppgaver og eksamen samt at vi holdt de samme forelesningene p√• begge campusene). I to √•r kj√∏rte vi et tradisjonelt kurs med forelesninger (to timer pr uke) og to st√∏rre innleveringsoppgaver i l√∏pet av semesteret.\nFaget SE-109 er godt egnet til √• opp√∏ve studentens refleksjonsevne og akademiske skriveferdigheter. Kurset har s√•ledes en litt annen tiln√¶rming enn mange av de tallbasert fagene √∏konomistudentene oftest m√∏ter ved en handelsh√∏yskole. Som et ledd i √• styrke denne tiln√¶rmingen s√∏kte vi, og fikk midler fra Det digitale universitet (DDU) til en omlegging fra en tradisjonell undervisningsform til videoforelesninger, seminarer og flere skriftlige innleveringer.\n\nHva ble gjort?\nF√∏lgende undervisningsopplegg ble designet:\nVideoer\nStudentene fikk presentert det faglige innholdet gjennom mange, korte videoinnslag som vi hadde lagd f√∏r semesterstart. Hensikten var √• trekke ut sentrale momenter fra pensum og gi studentene en start med √• lese litteraturen. For √• lage videoene valgte Olsen og Hunnes to ulike strategier. Olsen utarbeidet videoene sammen med PULS og Mediesenteret med tilh√∏rende distribusjon gjennom UiA Video (eksempel). Hunnes valgte √• lage videoene selv og brukte YouTube som distribusjonskanal (eksempel).\n\nCase og seminarer\nFor hver uke ble studentene presentert for et case som var forankret i ukens tema og tok for seg et etisk dilemma og/eller en bedrifts tiln√¶rming til samfunnsansvar.\nStudentmassen ble delt opp i fem storgrupper i Kristiansand (hver storgruppe p√• ca 70 studenter), mens kullet i Grimstad dannet √©n storgruppe. Hver storgruppe ble igjen delt opp i 10 mindre grupper p√• ca syv studenter, og disse arbeidet sammen gjennom hele semesteret med case og innleveringer.\nDen enkelte storgruppe ble samlet en gang i uken for √• diskutere caset. En av sm√•gruppene hadde ansvaret for √• presentere og lede gjennomgangen. Dette ble gjort for √• √∏ke studentenes aktivitet i faget og opp√∏ve studentenes generelle ferdigheter i presentasjonsteknikk. Fagl√¶rer var tilstede for √• bidra ved behov. Etter storsamlingen m√•tte hver sm√•gruppe skrive et to siders refleksjonsnotat om caset som ble levert inn via fronter. I l√∏pet av semesteret deltok og arbeidet studentene med 10 case, seminarer og innleveringer.\nDeltakelse p√• seminarene var bare obligatorisk for den enkelte student n√•r denne var del av gruppen som presenterte og ledet gjennomgangen av caset. Innlevering av alle de 10 refleksjonsnotatene var obligatorisk.\n\nEksamen\nEksamen ble avholdt som en 48 timer gruppebasert hjemmeeksamen hvor studentene arbeidet i grupper p√• 3-5 studenter med to reelle case. H√∏sten 2016 dreide det f√∏rste caset seg om NRK-dokumentaren ¬´Pengepredikanten¬ª mens det andre caset hadde fokus p√• samfunnsansvar i flyselskapet Norwegian.\n\nErfaringer pilot h√∏sten 2016\nJevnt over var studentene forn√∏yd med opplegget. Men basert p√• tilbakemeldinger b√•de gjennom bruk av SurveyExact og en dagssamling hvor alle tillitsvalgte var invitert foretok vi f√∏lgende justeringer f√∏r oppstarten h√∏sten 2017.\n‚Ä¢ En del studenter (spesielt i Grimstad) √∏nsket √• ha noen fellesforelesninger og ikke bare videoer. Vi introduserte derfor fem fellesforelsninger og reduserte antall seminarer og refleksjonsnotater fra ti til syv.\n‚Ä¢ St√∏rrelsen p√• storgruppene ble halvert, fra ca 70 til 35 studenter. Dette ble gjort for √• √∏ke den enkelte students deltakelse i diskusjonen p√• seminaret. Vi valgte ogs√• √• la studentene sitte i en halvsirkel uten tilgang p√• PC og telefon for √• √∏ke oppmerksomheten. Dette siste tiltaket har hatt en stor effekt p√• studentenes deltakelse i diskusjonen.\n‚Ä¢ Siden antall storgrupper ble doblet (som f√∏lge av halvering av gruppest√∏rrelsen) har vi engasjert tre studentassistener for √• avlaste de to fagl√¶rerne, med √• v√¶re til stede p√• seminarer og gi tilbakemelding p√• de innleverte refleksjonsnotatene. Dette ser ogs√• ut til √• v√¶re et godt og verdsatt tiltak.\n‚Ä¢ H√∏sten 2016 hadde vi problemer med at studentene ikke hadde forberedt seg til seminarene, og dermed ble ikke diskusjonen om caset s√• fruktbar som vi hadde h√•pet p√•. Vi tror at dette har sammenheng med at refleksjonsnotatene skulle leveres etter seminaret. Innev√¶rende h√∏st m√• studentene levere refleksjonsnotatet f√∏r seminaret. Utfordringen n√• (som kom opp i midtveisevalueringen) er at flere studenter synes at seminarene ikke tilf√∏rer noe nytt utover det gruppen selv har diskutert gjennom arbeidet med refleksjonsnotatet. Dette er en utfordring vi m√• l√∏se f√∏r h√∏sten 2018, det vil si hvordan kan vi organisere studentenes arbeid med b√•de refleksjonsnotatene og seminarene slik at de begge oppfattes som relevante og nyttige.\n‚Ä¢ Studentene bruker ulike tiln√¶rming og verkt√∏y i presentasjonen og gjennomgang i seminarene. PowerPoint og Kahoot brukes mye for √• innlede til diskusjon. I tillegg benyttes summegrupper og rollespill.\n‚Ä¢ Vi bruker Fronter for √• legge ut dokumenter etc. Men i den daglige kommunikasjonen med studentene har vi valgt √• bruke Facebook som er langt mer effektiv. En egen facebook-gruppe for hver gjennomf√∏ring av kurset blir opprettet: https://www.facebook.com/groups/SE109H17/ .\n\nOppsummering\nDet er utfordrende √• lage et alternativt undervisningsopplegg for en stor studentmasse (ca 400 studenter). Men erfaringene fra h√∏sten 2016 og 2017 (s√• langt) viser at vi er p√• riktig vei. Det er mulig √• kombinere forelesinger, videoer og seminarer med kravet om h√∏yt antall skriftlige innleveringer. N√•r det er sagt s√• kreves det mye organisering rundt opplegget, produksjon av videoer, skaffe til veie relevante case og involvering av ekstra undervisningspersonell. Det er planlagt utarbeidelse av en fagartikkel hvor erfaringene med, og resultatet av omleggingen blir diskutert grundigere.','Beta test','','draft','open','open','','','','','2017-11-01 08:31:13','2017-11-01 08:31:13','',0,'http://alumniuia.wpengine.com/?p=5',0,'post','',0),(8,3,'2017-11-08 12:17:34','2017-11-08 12:17:34','a:8:{s:8:\"location\";a:1:{i:0;a:1:{i:0;a:3:{s:5:\"param\";s:13:\"page_template\";s:8:\"operator\";s:2:\"==\";s:5:\"value\";s:18:\"template-about.php\";}}}s:8:\"position\";s:6:\"normal\";s:5:\"style\";s:7:\"default\";s:15:\"label_placement\";s:3:\"top\";s:21:\"instruction_placement\";s:5:\"label\";s:14:\"hide_on_screen\";a:1:{i:0;s:11:\"the_content\";}s:11:\"description\";s:0:\"\";s:5:\"local\";s:3:\"php\";}','About page','about-page','publish','closed','closed','','group_59490a4c8c4a1','','','2017-11-08 12:17:34','