p: 5px; margin-bottom: 15px; line-height: 23.8px; color: #333333; font-family: \'open sans\', arial, sans-serif; font-size: 14px;\">Jobbskyggevert: Ole Nordmann, Arkivator, Aust-Agder Museum og Arkiv, AAMA<br /><br />‚ÄùJobbskygge-dagen ga meg et godt innblikk i hvordan en dag i arbeidslivet er som arkivator p√• AAMA . Jeg fikk v√¶re med p√• m√∏ter b√•de med ledesen, og l√¶rte om bevaring av dokumenter og brev som Ole jobber med n√•. Jeg hadde sjansen til √• sp√∏rre om alt jeg har lurt p√• f√∏r, og fikk detaljerte svar. Jobbskygge er en unik mulighet √• bli kjent med en vanlig arbeidsdag p√• dr√∏mmejobben sin i en avslappet atmosf√¶re. Det kan ogs√• ta bort frykten eller respekten for √• ringe bedriften eller √• skrive en s√∏knad. Jeg fikk motivasjon for √• skrive en √•pen s√∏knad til AAMA‚Äù.<br /><br />Student: <strong>Eirik Andre St√•lesen</strong></p>		\n			<h2>Helse- og sosialfag</h2>		\n		<p style=\"margin-top: 15px; margin-bottom: 15px; line-height: 23.8px; color: #333333; font-family: \'open sans\', arial, sans-serif; font-size: 14px;\">Jobbskyggevert: Dole Nordman, Overlege, S√∏rlandet sykehus.<br /><br />\"Jeg mener at Jobbskyggedagen kan v√¶re en veldig bra mulighet for studenter √• f√• en bedre forst√•else for hvordan det er √• bruke sin utdanning i arbeidslivet, og hva som kan v√¶re viktig √• tenke p√• n√•r det gjelder √• komme seg ut i arbeidsmarkedet med den h√∏yere utdanningen man har. I tillegg er det en fin m√•te √• bli kjent med personer som jobber i samme fagfelt som man studerer, og p√• den m√•ten utvide sitt profesjonelle nettverk. Jeg tok med meg noen erfaringer og opplevelser som gj√∏r meg mer bevisst p√• hva mine interesser er og hvordan jeg burde tenke fremover i studiel√∏pet, samt at jeg fikk √∏kt motivasjon for studieretningen.\"<br /><br />Student: <b>Shiwan Hassan</b></p>		\n			<h2>Ingeni√∏r- og teknologiske fag</h2>		\n		<p style=\"margin-top: 15px; margin-bottom: 15px; line-height: 23.8px; color: #333333; font-family: \'open sans\', arial, sans-serif; font-size: 14px;\">Jobbskyggevert:¬†<a style=\"color: #804180; border-bottom: 1px dashed #dddddd;\" href=\"https://www.ngu.no/ansatte/fredrik-h-gaas\">D</a>offen Nordmann, SivilEngin√∏r, Statoil.<br /><br />\"Etter feltturen f√∏ler jeg at jeg har satset p√• riktig fagfelt, der jeg fikk teste ut utstyr jeg aldri har pr√∏vd f√∏r. Dette gj√∏r at jeg f√•r en bredere feltkompetanse i arbeidslivet. Det er viktig √• utnytte de mulighetene som er tilgjengelig. Selv om det er travelt p√• skolen, vil en jobbskyggedag komme sv√¶rt godt med n√•r man s√∏ker jobb.¬†\"<br /><br />Student:¬†<strong>Daniel Thorbj√∏rn Miranda Petteresen</strong></p>','Slik er det √• v√¶re jobbskygge','','publish','closed','closed','','slik-er-det-a-vaere-jobbskygge','','','2018-04-27 13:01:52','2018-04-27 12:01:52','',0,'http://alumniuia.wpengine.com/?page_id=251',0,'page','',0),(252,4,'2018-04-27 12:53:21','2018-04-27 11:53:21','{\n    \"nav_menu_item[150]\": {\n        \"value\": false,\n        \"type\": \"nav_menu_item\",\n        \"user_id\": 4,\n        \"date_modified_gmt\": \"2018-04-27 11:53:21\"\n    },\n    \"nav_menu_item[-3859201167743816700]\": {\n        \"value\": {\n            \"object_id\": 174,\n            \"object\": \"page\",\n            \"menu_item_parent\": 0,\n            \"position\": 6,\n            \"type\": \"post_type\",\n            \"title\": \"Log In\",\n            \"url\": \"http://alumniuia.wpengine.com/login/\",\n            \"target\": \"\",\n            \"attr_title\": \"\",\n            \"description\": \"\",\n            \"classes\": \"\",\n            \"xfn\": \"\",\n            \"status\": \"publish\",\n            \"original_title\": \"Log In\",\n            \"nav_menu_term_id\": 2,\n            \"_invalid\": false,\n            \"type_label\": \"Page\"\n        },\n        \"type\": \"nav_menu_item\",\n        \"user_id\": 4,\n        \"date_modified_gmt\": \"2018-04-27 11:53:21\"\n    }\n}','','','trash','closed','closed','','a4bb3305-